package TestDatas

import (
	"encoding/base64"
)

const longData1 = ""
const OpusLongDataBase64 = ""

const OpusDataBase64Zh = ""
const OpusDataBase64En = ""
const OpusEmpty = ""

type AudioData struct {
	FrameCnt int
	Data     []byte
}

var OpusDataLangMap map[string]AudioData
var FileId string

func GetOpusFrameCnt(data []byte) int {
	currIdx := 0
	pkgEnd := 0
	for {
		frameLen := int(data[pkgEnd])

		if pkgEnd+1+frameLen >= len(data) {
			return currIdx
		}

		pkgEnd += 1 + frameLen
		currIdx++
	}
}

func init() {
	OpusDataLangMap = make(map[string]AudioData, 10)

	OpusDataEn, _ := base64.StdEncoding.DecodeString(OpusDataBase64En)
	OpusFrameCnt := GetOpusFrameCnt(OpusDataEn)
	OpusDataLangMap["en"] = AudioData{
		FrameCnt: OpusFrameCnt,
		Data:     OpusDataEn,
	}

	OpusDataZh, _ := base64.StdEncoding.DecodeString(OpusDataBase64Zh)
	//OpusDataZh, _ := base64.StdEncoding.DecodeString(OpusLongDataBase64) //长语音
	// OpusDataZh, _ := base64.StdEncoding.DecodeString(longData1)
	OpusFrameCnt = GetOpusFrameCnt(OpusDataZh)

	OpusDataLangMap["zh"] = AudioData{
		FrameCnt: OpusFrameCnt,
		Data:     OpusDataZh,
	}

	OpusEmptyDecoed, _ := base64.StdEncoding.DecodeString(OpusEmpty)
	OpusFrameCnt = GetOpusFrameCnt(OpusEmptyDecoed)
	OpusDataLangMap["empty"] = AudioData{
		FrameCnt: OpusFrameCnt,
		Data:     OpusEmptyDecoed,
	}

	//log.Debugf("OpusFrameCnt %d",OpusFrameCnt)
}

func GetOpusFrames(index int, frames_in_pkg int, lang string) ([]byte, int) {

	currIdx := 0
	pkgEnd := 0
	audioData, exist := OpusDataLangMap[lang]
	if !exist {
		audioData = OpusDataLangMap["zh"]
	}
	if EmptyOpus {
		audioData = OpusDataLangMap["empty"]
	}
	endPkg := audioData.FrameCnt/frames_in_pkg - 1
	//log.Debugf("endPkg %d",endPkg)
	if index > endPkg {
		return nil, 1
	}

	for {
		frameLen := int(audioData.Data[pkgEnd])
		pkgBegin := pkgEnd
		for f := 0; f < frames_in_pkg; f++ {

			pkgEnd += 1 + frameLen
			frameLen = int(audioData.Data[pkgEnd])
		}

		if currIdx == index {
			isEnd := 0
			if index == endPkg {
				isEnd = 1
			}

			if ErrSeq && index == 5 {
				return nil, 0
			} else {
				return audioData.Data[pkgBegin:pkgEnd], isEnd
			}

		}
		currIdx++
	}
}
